00; //B is largest prime to use in trial division\n  ans = int2bigInt(0, k, 0);\n\n  //optimization: try larger and smaller B to find the best limit.\n\n  if (primes.length == 0) primes = findPrimes(30000); //check for divisibility by primes <=30000\n\n  if (rpprb.length != ans.length) rpprb = dup(ans);\n\n  for (;;) {\n    //keep trying random values for ans until one appears to be prime\n    //optimization: pick a random number times L=2*3*5*...*p, plus a\n    //   random element of the list of all numbers in [0,L) not divisible by any prime up to p.\n    //   This can reduce the amount of random number generation.\n\n    randBigInt_(ans, k, 0); //ans = a random odd number to check\n    ans[0] |= 1;\n    divisible = 0;\n\n    //check ans for divisibility by small primes up to B\n    for (i = 0; i < primes.length && primes[i] <= B; i++) {\n      if (modInt(ans, primes[i]) == 0 && !equalsInt(ans, primes[i])) {\n        divisible = 1;\n        break;\n      }\n    } //optimization: change millerRabin so the base can be bigger than the number being checked, then eliminate the while here.\n\n    //do n rounds of Miller Rabin, with random bases less than ans\n    for (i = 0; i < n && !divisible; i++) {\n      randBigInt_(rpprb, k, 0);\n      while (!greater(ans, rpprb)) {\n        //pick a random rpprb that's < ans\n        randBigInt_(rpprb, k, 0);\n      }if (!millerRabin(ans, rpprb)) divisible = 1;\n    }\n\n    if (!divisible) return ans;\n  }\n}\n\n//return a new bigInt equal to (x mod n) for bigInts x and n.\nfunction mod(x, n) {\n  var ans = dup(x);\n  mod_(ans, n);\n  return trim(ans, 1);\n}\n\n//return (x+n) where x is a bigInt and n is an integer.\nfunction addInt(x, n) {\n  var ans = expand(x, x.length + 1);\n  addInt_(ans, n);\n  return trim(ans, 1);\n}\n\n//return x*y for bigInts x and y. This is faster when y<x.\nfunction mult(x, y) {\n  var ans = expand(x, x.length + y.length);\n  mult_(ans, y);\n  return trim(ans, 1);\n}\n\n//return (x**y mod n) where x,y,n are bigInts and ** is exponentiation.  0**0=1. Faster for odd n.\nfunction powMod(x, y, n) {\n  var ans = expand(x, n.length);\n  powMod_(ans, trim(y, 2), trim(n, 2)); //this should work without the trim, but doesn't\n  return trim(ans, 1);\n}\n\n//return (x-y) for bigInts x and y.  Negative answers will be 2s complement\nfunction sub(x, y) {\n  var ans = expand(x, x.length > y.length ? x.length + 1 : y.length + 1);\n  sub_(ans, y);\n  return trim(ans, 1);\n}\n\n//return (x+y) for bigInts x and y.\nfunction add(x, y) {\n  var ans = expand(x, x.length > y.length ? x.length + 1 : y.length + 1);\n  add_(ans, y);\n  return trim(ans, 1);\n}\n\n//return (x**(-1) mod n) for bigInts x and n.  If no inverse exists, it returns null\nfunction inverseMod(x, n) {\n  var ans = expand(x, n.length);\n  var s = inverseMod_(ans, n);\n\n  return s ? trim(ans, 1) : null;\n}\n\n//return (x*y mod n) for bigInts x,y,n.  For greater speed, let y<x.\nfunction multMod(x, y, n) {\n  var ans = expand(x, n.length);\n  multMod_(ans, y, n);\n  return trim(ans, 1);\n}\n\n//generate a k-bit true random prime using Maurer's algorithm,\n//and put it into ans.  The bigInt ans must be large enough to hold it.\nfunction randTruePrime_(ans, k) {\n  var c, m, pm, dd, j, r, B, divisible, z, zz, recSize;\n  var w;\n  if (primes.length == 0) primes = findPrimes(30000); //check for divisibility by primes <=30000\n\n  if (pows.length == 0) {\n    pows = new Array(512);\n    for (j = 0; j < 512; j++) {\n      pows[j] = Math.pow(2, j / 511. - 1.);\n    }\n  }\n\n  //c and m should be tuned for a particular machine and value of k, to maximize speed\n  c = 0.1; //c=0.1 in HAC\n  m = 20; //generate this k-bit number by first recursively generating a number that has between k/2 and k-m bits\n  //stop recursion when k <=recLimit.  Must have recLimit >= 2\n\n  if (s_i2.length != ans.length) {\n    s_i2 = dup(ans);\n    s_R = dup(ans);\n    s_n1 = dup(ans);\n    s_r2 = dup(ans);\n    s_d = dup(ans);\n    s_x1 = dup(ans); //TODO Seems like a bug in eslint, reports as unused\n    s_x2 = dup(ans);\n    s_b = dup(ans);\n    s_n = dup(ans);\n    s_i = dup(ans);\n    s_rm = dup(ans);\n    s_q = dup(ans);\n    s_a = dup(ans);\n    s_aa = dup(ans);\n  }\n\n  if (k <= 20) {\n    //generate small random primes by trial division up to its square root\n    pm = (1 << (k + 2 >> 1)) - 1; //pm is binary number with all ones, just over sqrt(2^k)\n    copyInt_(ans, 0);\n    for (dd = 1; dd;) {\n      dd = 0;\n      ans[0] = 1 | 1 << k - 1 | Math.floor(Math.random() * (1 << k)); //random, k-bit, odd integer, with msb 1\n      for (j = 1; j < primes.length && (primes[j] & pm) == primes[j]; j++) {\n        //trial division by all primes 3...sqrt(2^k)\n        if (0 == ans[0] % primes[j]) {\n          dd = 1;\n          break;\n        }\n      }\n    }\n    carry_(ans);\n    return;\n  }\n\n  B = c * k * k; //try small primes up to B (or all the primes[] array if the largest is less than B).\n  if (k > 2 * m) //generate this k-bit number by first recursively generating a number that has between k/2 and k-m bits\n    for (r = 1; k - k * r <= m;) {\n      r = pows[Math.floor(Math.random() * 512)];\n    } //r=Math.pow(2,Math.random()-1);\n  else r = .5;\n\n  //simulation suggests the more complex algorithm using r=.333 is only slightly faster.\n\n  recSize = Math.floor(r * k) + 1;\n\n  randTruePrime_(s_q, recSize);\n  copyInt_(s_i2, 0);\n  s_i2[Math.floor((k - 2) / bpe)] |= 1 << (k - 2) % bpe; //s_i2=2^(k-2)\n  divide_(s_i2, s_q, s_i, s_rm); //s_i=floor((2^(k-1))/(2q))\n\n  z = bitSize(s_i);\n\n  for (;;) {\n    for (;;) {\n      //generate z-bit numbers until one falls in the range [0,s_i-1]\n      randBigInt_(s_R, z, 0);\n      if (greater(s_i, s_R)) break;\n    } //now s_R is in the range [0,s_i-1]\n    addInt_(s_R, 1); //now s_R is in the range [1,s_i]\n    add_(s_R, s_i); //now s_R is in the range [s_i+1,2*s_i]\n\n    copy_(s_n, s_q);\n    mult_(s_n, s_R);\n    multInt_(s_n, 2);\n    addInt_(s_n, 1); //s_n=2*s_R*s_q+1\n\n    copy_(s_r2, s_R);\n    multInt_(s_r2, 2); //s_r2=2*s_R\n\n    //check s_n for divisibility by small primes up to B\n    for (divisible = 0, j = 0; j < primes.length && primes[j] < B; j++) {\n      if (modInt(s_n, primes[j]) == 0 && !equalsInt(s_n, primes[j])) {\n        divisible = 1;\n        break;\n      }\n    }if (!divisible) //if it passes small primes check, then try a single Miller-Rabin base 2\n      if (!millerRabinInt(s_n, 2)) //this line represents 75% of the total runtime for randTruePrime_\n        divisible = 1;\n\n    if (!divisible) {\n      //if it passes that test, continue checking s_n\n      addInt_(s_n, -3);\n      for (j = s_n.length - 1; s_n[j] == 0 && j > 0; j--) {} //strip leading zeros\n      for (zz = 0, w = s_n[j]; w; w >>= 1, zz++) {}\n      zz += bpe * j; //zz=number of bits in s_n, ignoring leading zeros\n      for (;;) {\n        //generate z-bit numbers until one falls in the range [0,s_n-1]\n        randBigInt_(s_a, zz, 0);\n        if (greater(s_n, s_a)) break;\n      } //now s_a is in the range [0,s_n-1]\n      addInt_(s_n, 3); //now s_a is in the range [0,s_n-4]\n      addInt_(s_a, 2); //now s_a is in the range [2,s_n-2]\n      copy_(s_b, s_a);\n      copy_(s_n1, s_n);\n      addInt_(s_n1, -1);\n      powMod_(s_b, s_n1, s_n); //s_b=s_a^(s_n-1) modulo s_n\n      addInt_(s_b, -1);\n      if (isZero(s_b)) {\n        copy_(s_b, s_a);\n        powMod_(s_b, s_r2, s_n);\n        addInt_(s_b, -1);\n        copy_(s_aa, s_n);\n        copy_(s_d, s_b);\n        GCD_(s_d, s_n); //if s_b and s_n are relatively prime, then s_n is a prime\n        if (equalsInt(s_d, 1)) {\n          copy_(ans, s_aa);\n          return; //if we've made it this far, then s_n is absolutely guaranteed to be prime\n        }\n      }\n    }\n  }\n}\n\n//Return an n-bit random BigInt (n>=1).  If s=1, then the most significant of those n bits is set to 1.\nfunction randBigInt(n, s) {\n  var a, b;\n  a = Math.floor((n - 1) / bpe) + 2; //# array elements to hold the BigInt with a leading 0 element\n  b = int2bigInt(0, 0, a);\n  randBigInt_(b, n, s);\n  return b;\n}\n\n//Set b to an n-bit random BigInt.  If s=1, then the most significant of those n bits is set to 1.\n//Array b must be big enough to hold the result. Must have n>=1\nfunction randBigInt_(b, n, s) {\n  var i, a;\n  for (i = 0; i < b.length; i++) {\n    b[i] = 0;\n  }a = Math.floor((n - 1) / bpe) + 1; //# array elements to hold the BigInt\n  for (i = 0; i < a; i++) {\n    b[i] = Math.floor(Math.random() * (1 << bpe - 1));\n  }\n  b[a - 1] &= (2 << (n - 1) % bpe) - 1;\n  if (s == 1) b[a - 1] |= 1 << (n - 1) % bpe;\n}\n\n//Return the greatest common divisor of bigInts x and y (each with same number of elements).\nfunction GCD(x, y) {\n  var xc, yc;\n  xc = dup(x);\n  yc = dup(y);\n  GCD_(xc, yc);\n  return xc;\n}\n\n//set x to the greatest common divisor of bigInts x and y (each with same number of elements).\n//y is destroyed.\nfunction GCD_(x, y) {\n  var i, xp, yp, A, B, C, D, q, sing;\n  var qp;\n  if (T.length != x.length) T = dup(x);\n\n  sing = 1;\n  while (sing) {\n    //while y has nonzero elements other than y[0]\n    sing = 0;\n    for (i = 1; i < y.length; i++) {\n      //check if y has nonzero elements other than 0\n      if (y[i]) {\n        sing = 1;\n        break;\n      }\n    }if (!sing) break; //quit when y all zero elements except possibly y[0]\n\n    for (i = x.length; !x[i] && i >= 0; i--) {} //find most significant element of x\n    xp = x[i];\n    yp = y[i];\n    A = 1;B = 0;C = 0;D = 1;\n    while (yp + C && yp + D) {\n      q = Math.floor((xp + A) / (yp + C));\n      qp = Math.floor((xp + B) / (yp + D));\n      if (q != qp) break;\n      t = A - q * C;A = C;C = t; //  do (A,B,xp, C,D,yp) = (C,D,yp, A,B,xp) - q*(0,0,0, C,D,yp)\n      t = B - q * D;B = D;D = t;\n      t = xp - q * yp;xp = yp;yp = t;\n    }\n    if (B) {\n      copy_(T, x);\n      linComb_(x, y, A, B); //x=A*x+B*y\n      linComb_(y, T, D, C); //y=D*y+C*T\n    } else {\n      mod_(x, y);\n      copy_(T, x);\n      copy_(x, y);\n      copy_(y, T);\n    }\n  }\n  if (y[0] == 0) return;\n  t = modInt(x, y[0]);\n  copyInt_(x, y[0]);\n  y[0] = t;\n  while (y[0]) {\n    x[0] %= y[0];\n    t = x[0];x[0] = y[0];y[0] = t;\n  }\n}\n\n//do x=x**(-1) mod n, for bigInts x and n.\n//If no inverse exists, it sets x to zero and returns 0, else it returns 1.\n//The x array must be at least as large as the n array.\nfunction inverseMod_(x, n) {\n  var k = 1 + 2 * Math.max(x.length, n.length);\n\n  if (!(x[0] & 1) && !(n[0] & 1)) {\n    //if both inputs are even, then inverse doesn't exist\n    copyInt_(x, 0);\n    return 0;\n  }\n\n  if (eg_u.length != k) {\n    eg_u = new Array(k);\n    eg_v = new Array(k);\n    eg_A = new Array(k);\n    eg_B = new Array(k);\n    eg_C = new Array(k);\n    eg_D = new Array(k);\n  }\n\n  copy_(eg_u, x);\n  copy_(eg_v, n);\n  copyInt_(eg_A, 1);\n  copyInt_(eg_B, 0);\n  copyInt_(eg_C, 0);\n  copyInt_(eg_D, 1);\n  for (;;) {\n    while (!(eg_u[0] & 1)) {\n      //while eg_u is even\n      halve_(eg_u);\n      if (!(eg_A[0] & 1) && !(eg_B[0] & 1)) {\n        //if eg_A==eg_B==0 mod 2\n        halve_(eg_A);\n        halve_(eg_B);\n      } else {\n        add_(eg_A, n);halve_(eg_A);\n        sub_(eg_B, x);halve_(eg_B);\n      }\n    }\n\n    while (!(eg_v[0] & 1)) {\n      //while eg_v is even\n      halve_(eg_v);\n      if (!(eg_C[0] & 1) && !(eg_D[0] & 1)) {\n        //if eg_C==eg_D==0 mod 2\n        halve_(eg_C);\n        halve_(eg_D);\n      } else {\n        add_(eg_C, n);halve_(eg_C);\n        sub_(eg_D, x);halve_(eg_D);\n      }\n    }\n\n    if (!greater(eg_v, eg_u)) {\n      //eg_v <= eg_u\n      sub_(eg_u, eg_v);\n      sub_(eg_A, eg_C);\n      sub_(eg_B, eg_D);\n    } else {\n      //eg_v > eg_u\n      sub_(eg_v, eg_u);\n      sub_(eg_C, eg_A);\n      sub_(eg_D, eg_B);\n    }\n\n    if (equalsInt(eg_u, 0)) {\n      while (negative(eg_C)) {\n        //make sure answer is nonnegative\n        